import { React } from "react";

export const GenerateTableRow = (project_data) => {
  console.log(project_data);
  return project_data.map((row) => (
    <TableRow>
      {Object.values(row).map((rowValue) => (
        <TableRowColumn>{rowValue}</TableRowColumn>
      ))}
    </TableRow>
  ));
};
